LaView NET is a mobile phone surveillance application based on ios, which supports full line of Brovision products, including DVR, NVR, as well as network cameras and speed domes that support standard H.264 video codec. 

The key features of LaView NET Mobile Surveillance Application include: 
· Real-time video preview of up to 16 channels; 
· Swipe for PTZ control and camera movement, pinch to zoom in and out in preview mode; 
· Support for preset activation and configuration, as well as calibration for brightness.. 
· Snapshot support; 
· Management of up to 100 sets of devices. Device profiles can be added / deleted / modified.
